script: |
  super -f text -I q12629.spq | sort > q12629.out

inputs:
  - name: q12629.spq
    data: |
      SELECT ALL - + 8 AS col2, + col0 * col2 FROM tab2 (FORMAT parquet) WHERE ( NULL ) NOT BETWEEN col2 AND col0 * - col2 + - + 24 - + col2 * + col2;
  - name: tab2

outputs:
  - name: q12629.out
    data: |
